import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';

function Hero() {
  return (
    <Box
      sx={{
        paddingY: 10,
        textAlign: 'center',
        color: '#ffffff',
        backgroundImage: 'url("path-to-water-background.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
      }}
    >
      <Container maxWidth="md">
        <Typography
          variant="h3"
          sx={{ fontWeight: 'bold', marginBottom: 3, textShadow: '0px 0px 10px rgba(0, 0, 0, 0.5)' }}
        >
          Compete in the Best Online Fishing Tournaments
        </Typography>
        <Typography
          variant="body1"
          sx={{ fontSize: '1.2rem', marginBottom: 5, color: '#f2e1c1' }}
        >
          Join tournaments, win big, and connect with anglers worldwide.
        </Typography>
        <Button
          variant="contained"
          size="large"
          href="#signup"
          sx={{
            backgroundColor: '#004d61',
            color: '#ffffff',
            paddingX: 4,
            paddingY: 1.5,
            '&:hover': { backgroundColor: '#003745' },
          }}
        >
          Get Started
        </Button>
      </Container>
    </Box>
  );
}

export default Hero;
